import React, {} from 'react';
import { useNavigate } from 'react-router-dom';
import Schedule from '../components/Schedule';
import VerifyEvents from '../components/VerifyEvents';
import UpcomingEvents from '../components/UpcomingEvents';

function Admin() {
  const navigate = useNavigate();
  const [search, setSearch] = useState("");
  const handleTitleClick = () => {
    navigate('/admin');
  }
  const handleLogout = () => {
    navigate('/');
  }
  return (
    <div>
      <div className='navbar'>
        <div className='home-website-title' onClick={handleTitleClick}>CampusHive</div>
        <div className='left-menu'>
          <button className='logout-btn' onClick={handleLogout}><img alt='Logout' src={require('../images/log-icon.png')} className='icon' /></button>
        </div>
      </div>
      <h2>Hello, Admin</h2>
      <div>{<Schedule />}</div>
      <div>{<VerifyEvents />}</div>
      <div>
        <input
          placeholder='Search Events & Workshops...'
          type='text'
          name='search'
          onChange={(e) => {
            setSearch(e.target.value);
          }}
        />
      </div>
      <div>{<UpcomingEvents />}</div>
    </div>
  )
}

export default Admin
